import "./App.css";
import logoImg from "./components/image/logo.png";
import star from "./components/image/star.png";

export default function App() {
  return (
    <div className="App">
      <div className="container">
        <div class="wave"></div>
        <div class="wave"></div>
        <div className="circle">
          <img src={logoImg} alt="Center Image" />
        </div>
        <div className="square">
          <img src={star} alt="Image" />
        </div>
      </div>
    </div>
  );
}
